package com.saraya.service;

import java.util.ArrayList;
import java.util.Iterator;
import java.util.List;

import com.saraya.model.Phone;

public class PhoneService {


	private static ArrayList<Phone> phones=new ArrayList<Phone>();
	private static int count=4;
	
	static {
		phones.add(new Phone(1,2019,"Huawei","Y9 prime","Green","data:image/jpeg;base64, "));
		phones.add(new Phone(2,2019,"Motorola","Razr","Black","data:image/jpeg;base64, "));
		phones.add(new Phone(3,2022,"Iphone","12 Pro Max","Dark grey","data:image/jpeg;base64, "));
		phones.add(new Phone(4,2021,"Xiaomi","RedMi Note 10","White","data:image/jpeg;base64, "));
		
	}
	
	public List<Phone> getAllPhones(){
		return phones;
	}
	public void addPhone(int year, String make, String model,String color,String image) {
		phones.add(new Phone(++count,year,make,model,color,image));
	}
	public void deletePhone(int id) {
		Iterator<Phone> iterate=phones.iterator();
		while(iterate.hasNext()) {
			Phone phone=iterate.next();
			if(phone.getId()==id) {
				iterate.remove();
			}
		}
	
	}
}
